"use strict";const createElement=React.createElement;class CounterButton extends React.Component{constructor(t){super(t),this.state={count:0}}onClick_BTNCounter(t){let e=this.state.count+1;this.setState({count:e})}render(){return createElement("button",{onClick:t=>{this.onClick_BTNCounter(t)}},`${this.props.message||"Count"}: ${this.state.count}`)}}let containers=Array.from(document.getElementsByClassName("counterButtonContainer"));containers.forEach(t=>{let e={message:t.dataset.message};ReactDOM.render(createElement(CounterButton,e),t)});